using System;\n\nclass Program\n{\n    static void Main()\n    {\n        string fin = "S9876543A"; // Example FIN\n        Console.WriteLine($"Is the FIN {fin} valid? {IsValidFin(fin)}");\n    }\n\n    static bool IsValidFin(string fin)\n    {\n        if (fin.Length != 9) return false;\n        \n        char prefix = fin[0];\n        int weights[] = { 2, 7, 6, 5, 4, 3, 2 };\n        string validPrefixes = "ST";\n        \n        if (!validPrefixes.Contains(prefix)) return false;\n\n        int total = 0;\n        for (int i = 1; i <= weights.Length; i++)\n        {\n            if (!char.IsDigit(fin[i])) return false;\n            total += int.Parse(fin[i].ToString()) * weights[i - 1];\n        }\n\n        const string checkTableS = "JZIHGFEDCBA";\n        const string checkTableT = "GHIJKLDEFAB";\n\n        char checkChar = fin[8];\n        \n        // Adjust the total when prefix is 'T'\n        if (prefix == 'T') total += 4;\n\n        int remainder = total % 11;\n        string tableToUse = (prefix == 'S') ? checkTableS : checkTableT;\n        char expectedCheckChar = tableToUse[remainder];\n\n        return checkChar == expectedCheckChar;   \n    }\n}